// background.js

// Handle messages from popup.js
chrome.runtime.onMessage.addListener(async (message, sender, sendResponse) => {
	if (message.type === "PROCESS_TEXT") {
		const { text } = message;

		try {
			// Call the LLM API (using the function you 			defined for LLM)
			const rewrittenText = await callLlm("summarize", text); // or "summarize"

			// Send the rewritten text back to popup.js
			sendResponse({ rewrittenText });

		} catch (error) {
			console.error("Error processing text with LLM:", error);
			sendResponse({ rewrittenText: "Error processing text" });
		}

		// Return true to indicate that we'll send a response asynchronously
		return true;
	}

	// You can handle other message types here if needed (like TTS_REQUEST, etc.)
});

// Call to LLM (this is the function from earlier)
async function callLlm(mode, text) {
	const LLM_API_URL = "https://<api-id>.execute-api.<region>.amazonaws.com/llm";

	const res = await fetch(LLM_API_URL, {
		method: "POST",
		headers: { "Content-Type": "application/json" },
		body: JSON.stringify({
			mode,
			text,
			requestId: crypto.randomUUID?.() || Date.now().toString()
		})
	});

	const data = await res.json();

	if (data.success) {
		return data.outputText; // The simplified or summarized text
	}

	// Handle fallback
	if (data.fallbackText) {
		console.warn("LLM failed, using fallbackText:", data.error);
		return data.fallbackText;
	}

	throw new Error(data.error?.message || "LLM call failed");
}







